Thought: 
We are asked to find $f(-1)$, but there is an issue as $x = -1$ is where the denominator equals zero, creating a hole in the function.

We can use long division to rewrite the function so that it doesn't have a fraction:

\begin{align*}
f(x) &= \frac{x^2 - 6x + 3}{x - 1} \\
f(x) &= x^2 - 5x + \frac{8}{x - 1}
\end{align*}

Now we can plug in $x = -1$:

\begin{align*}
f(-1) &= (-1)^2 - 5(-1) + \frac{8}{(-1) - 1} \\
f(-1) &= 1 + 5 + \frac{8}{-2} \\
f(-1) &= 6 - 4 \\
f(-1) &= \boxed{2}
\end{align*}

So the answer is $f(-1) = 2$, or choice "C".
Action: Answer("C")

Thought: 
First, we can rationalize the denominator by multiplying the numerator and denominator of the fraction by $(x+2)(x+3)$:

\begin{align*}
\frac{1}{\frac{1}{x+2}+\frac{1}{x+3}} &= \frac{(x+2)(x+3)}{(x+2)(x+3)\left(\frac{1}{x+2}+\frac{1}{x+3}\right)} \\
&= \frac{(x+2)(x+3)}{(x+2)+(x+3)} \\
&= \frac{(x+2)(x+3)}{2 x+5}
\end{align*}

Now, we can simplify the numerator by expanding and combining like terms:

\begin{align*}
\frac{(x+2)(x+3)}{2 x+5} &= \frac{x^2 + 5x + 6}{2x + 5}
\end{align*}

Therefore, the correct answer is B: $\frac{x^2 + 5x + 6}{2x + 5}$.
Action: Answer("B")

